import React, { useState } from 'react';
import Icon from "react-native-vector-icons/AntDesign";
import Icon1 from "react-native-vector-icons/Feather";
import { SafeAreaView, View, Text, ScrollView, StyleSheet, TouchableOpacity } from 'react-native';
import {
    FirstView,
    BigText,
    SecondView,
    BtnText
} from '../componenets/fintech1Style'

export default function Fintech1({navigation}){
    return( 
    <SafeAreaView style={styles.container}>
     <ScrollView>
         <FirstView>
         <Icon size={20} color="#C3AD60" name="back" style={styles.pad}/>
            <BigText style={styles.pad}>Procurement Service</BigText>
         <Icon1 size={20} color="#C3AD60" name="clipboard" style={styles.pad}/>
         </FirstView>
         <SecondView>
            <TouchableOpacity style={styles.btn} onPress={()=>navigation.navigate("Fintech2")}>
             <BtnText>Paste Link</BtnText>
            </TouchableOpacity>
            <View style={styles.txt}><MiddleText>-Or-</MiddleText></View>
            <TouchableOpacity style={styles.btn1}>
                <BtnText>Upload Photo</BtnText>
            </TouchableOpacity>
         </SecondView>
     </ScrollView>
    </SafeAreaView>
     
    )
   
}

const styles = StyleSheet.create({
container: {
    backgroundColor: "#000",
    paddingTop: 25,
    flex: 1,

},
pad: {
    padding: 30,
    color: "#CDA630",
},
btn: {
    backgroundColor: "#CDAD30",
    borderRadius: 100,
    height: 65,
    width: 320,
    alignItems: "center",
    justifyContent: "center",
    color: "#000"
},
btn1: {
    marginTop: 100,
    backgroundColor: "#CDA630",
    borderRadius: 100,
    height: 65,
    width: 320,
    alignItems: "center",
    justifyContent: "center",
    color: "#000",
},
btnText: {
    color: "#000",
    fontFamily: "Roboto",
},
txt: {
    marginTop: 40,
    alignItems: "center",
    justifyContent: "center",
    color: "#fff"
}
});
